/// Returns the IconData for the given icon name and optional stroke width.
/// Stroke width should be one of: 100, 200, 300, 400, 500, 600
/// If stroke width is null or not a valid variant, returns the base icon.
IconData? getLucideIcon(String name, [int? strokeWidth]) {
  if (strokeWidth != null && [100, 200, 300, 400, 500, 600].contains(strokeWidth)) {
    final variantName = '$name$strokeWidth';
    final variantIcon = kLucideIconVariantMap[variantName];
    if (variantIcon != null) return variantIcon;
  }
  return kLucideIconMap[name];
}

